import React from "react";
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as RiIcons from 'react-icons/ri'

export const SidebarData = [
    {
        heading : "Tableau de bord",
        icon:<RiIcons.RiDashboardFill style={{width:"25px", height:"25px"}}/>,
        number:null
    },
    {
        heading : "Nouvelle Demande",
        icon:<AiIcons.AiFillFileAdd style={{width:"25px", height:"25px"}}/>,
        number:null,
    },
    {
        heading : "En Verification", 
        icon:<AiIcons.AiOutlineFileSync style={{width:"25px", height:"25px"}}/>,
        number:0,
        color:'#EBE100'
    },
    {
        heading : "À completer",
        icon:<RiIcons.RiFileChart2Fill style={{width:"25px", height:"25px"}}/>,
        number:0,
        color:'#E47B00'

    },
    {
        heading : "Dossier Traités",
        icon:<AiIcons.AiOutlineFileDone style={{width:"25px", height:"25px"}}/>,
        number:0,
        color:'#00E432'
    },
    {
        heading : "Refusés",
        icon:<AiIcons.AiFillFileExcel style={{width:"25px", height:"25px"}}/>,
        number:0,
        color:'#CD004A'
    },
    {
        heading : "Liste des clients",
        icon:<FaIcons.FaUsers style={{width:"25px", height:"25px"}}/>,
        number:null
    },
    {
        heading : "Rapport",
        icon:<AiIcons.AiOutlineFileProtect style={{width:"25px", height:"25px"}}/>,
        number:null
    },
    {
        heading : "Revenus",
        icon:<RiIcons.RiMoneyEuroCircleFill style={{width:"25px", height:"25px"}}/>,
        number:null
    },

]
